. \u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0437\u0430\u043d\u044f\u043b\u0438 \u041f\u0430\u043f\u0441\u043a\u0443\u044e \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u0438 \u0432\u043e\u0448\u043b\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC\" title=\"\u0420\u0438\u043c\">\u0420\u0438\u043c<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0431\u044b\u043b \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0451\u043d \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u0430. \u041f\u0430\u043f\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%B9_IX_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041f\u0438\u0439 IX (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041f\u0438\u0439 IX<\/a> (Pius PP. IX) \u043e\u0442\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u0432\u0435\u0441\u0442\u0438 \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u044b \u0441 \u043d\u043e\u0432\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u044c\u044e, \u0443\u0434\u0430\u043b\u0438\u043b\u0441\u044f \u0432 \u0441\u0432\u043e\u0439 \u0434\u0432\u043e\u0440\u0435\u0446 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0430\u0442\u0438\u043a\u0430\u043d\">\u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0435<\/a> \u0438 \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u0441\u0435\u0431\u044f \u0438 \u0441\u0432\u043e\u0438\u0445 \u043f\u0440\u0435\u0435\u043c\u043d\u0438\u043a\u043e\u0432 \u043d\u0430 \u043f\u0430\u043f\u0441\u043a\u043e\u043c \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0435 \u00ab\u0432\u0430\u0442\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u043c\u0438 \u043f\u043b\u0435\u043d\u043d\u0438\u043a\u0430\u043c\u0438\u00bb. \u0422\u0430\u043a\u043e\u0435 \u043f\u043e\u043b\u