4f<\/a>. \u0425\u0440\u043e\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438 \u041a\u0430\u043d\u043d\u044b \u043d\u0435 \u0431\u044b\u043b\u0438 \u043f\u0435\u0440\u0432\u044b\u043c\u0438: \u043f\u0435\u0440\u0432\u043e\u0439 \u0431\u044b\u043b\u0430 \u0412\u0435\u043d\u0435\u0446\u0438\u044f. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%86%D0%B8%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B8%D0%BD%D0%BE%D1%84%D0%B5%D1%81%D1%82%D0%B8%D0%B2%D0%B0%D0%BB%D1%8C\" title=\"\u0412\u0435\u043d\u0435\u0446\u0438\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u0438\u043d\u043e\u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c\">\u0412\u0435\u043d\u0435\u0446\u0438\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u0438\u043d\u043e\u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c<\/a> \u0437\u0430\u043c\u044b\u0448\u043b\u044f\u043b\u0441\u044f \u043a\u0430\u043a \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044f \u0441\u0438\u043b\u044b \u0438 \u0441\u043b\u0430\u0432\u044b \u0444\u0430\u0448\u0438\u0441\u0442\u0441\u043a\u043e\u0433\u043e \u0440\u0435\u0436\u0438\u043c\u0430. \u0412\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438, \u0447\u0443\u0432\u0441\u0442\u0432\u0443\u044e\u0449\u0435\u0439, \u0447\u0442\u043e \u0442\u0443\u0447\u0438 \u0441\u0433\u0443\u0449\u0430\u044e\u0442\u0441\u044f, \u0432\u043e\u0437\u043d\u0438\u043a\u043b\u0430 \u0438\u0434\u0435\u044f \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0444\u0430\u0448\u0438\u0441\u0442\u0441\u043a\u043e\u043c\u0443 \u043a\u0438\u043d\u043e&#160;\u2014 \u043a\u0438\u043d\u043e \u00ab\u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0433\u043e \u043c\u0438\u0440\u0430\u00bb. \u0412 1939 \u0433\u043e\u0434\u0443 \u0432\u0441\u0451 \u0443\u0436\u0435 \u0431\u044b\u043b\u043e \u0433\u043e\u0442\u043e\u0432\u043e&#160;\u2014 \u0438 \u0442\u0443\u0442 \u0433\u0440\u044f\u043d\u0443\u043b\u0430 \u0432\