435\u043a\u0430 (1994)\">\u041a\u043e\u043d\u0442\u0440\u0430\u043a\u0442 \u0432\u0435\u043a\u0430<\/a>\u00bb \u043f\u0440\u0430\u0432\u043e \u0434\u043e\u0431\u044b\u0447\u0438 \u043a\u0430\u0441\u043f\u0438\u0439\u0441\u043a\u043e\u0439 \u043d\u0435\u0444\u0442\u0438 (\u0420\u043e\u0441\u0441\u0438\u044f \u0437\u0430\u044f\u0432\u0438\u043b\u0430 \u043e \u043d\u0435\u0437\u0430\u043a\u043e\u043d\u043d\u043e\u0441\u0442\u0438 \u044d\u0442\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1997\" class=\"mw-redirect\" title=\"1997\">1997<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%BE%D0%BD,_%D0%AD%D0%BB%D1%82%D0%BE%D0%BD\" title=\"\u0414\u0436\u043e\u043d, \u042d\u043b\u0442\u043e\u043d\">\u042d\u043b\u0442\u043e\u043d \u0414\u0436\u043e\u043d<\/a> \u0432 \u043f\u044f\u0442\u044b\u0439 \u0440\u0430\u0437 \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u0438\u043b \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 \u0445\u0438\u0442-\u043f\u0430\u0440\u0430\u0434 \u0441\u043e \u0441\u0442\u0430\u0440\u043e\u0439 \u043f\u0435\u0441\u043d\u0435\u0439 \u00abCandle in the Wind\u00bb, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u043e\u043d \u043f\u043e\u0441\u0432\u044f\u0442\u0438\u043b \u043f\u0430\u043c\u044f\u0442\u0438 \u043f\u043e\u0433\u0438\u0431\u0448\u0435\u0439 \u043f\u0440\u0438\u043d\u0446\u0435\u0441\u0441\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%B0%D0%BD%D0%B0_(%D0%BF%D1%80%D0%B8%D0%BD%D1%86%D0%B5%D1%81%D1%81%D0%B0_%D0%A3%D1%8D%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F)\" class=\"mw-redirect\" title=\"\u0414\u0438\u0430\u043d\u0430 (\u043f\u0440\u0438\u043d\u0446\u0435\u0441\u0441\u0430 \u0423\u044d\u043b\u044c\u0441\u043a\u0430\u044f)\">\u0414\u0438\u0430\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1999\" class=\"mw-redirect\" title=\"1999\">1999<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B2%D0%B5%D1%80%D0%BF%D0%B5%D0%BD\" title=\"\u0410\u043d\u0442\u0432\u0435\u0440\u043f\u0435\u043d\">\u0410\u043d\u0442\u0432\u0435\u0440\u043f\u0435\u043d\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0411\u0435\u043b\u044c\u0433\u0438\u044f<\/a>) \u043d\u0430\u0447\u0430\u043b\u0430 \u0440\u0430\u0431\u043e\u0442\u0443 \u00ab\u0448\u043a\u043e\u043b\u0430 \u043f\u0440\u043e\u0441\u0442\u0438\u0442\u0443\u0442\u043e\u043a\u00bb. \u041d\u0430 \u043a\u0443\u0440\u0441\u044b \u043c\u043e\u0433\u043b\u0438 \u0431\u044b\u0442\u044c \u0437\u0430\u0447\u0438\u0441\u043b\u0435\u043d\u044b \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u00ab\u043d\u0430\u0447\u0438\u043d\u0430\u044e\u0449\u0438\u0435\u00bb, \u043d\u043e \u0438 \u0442\u0435, \u043a\u0442\u043e \u0445\u043e\u0442\u044f\u0442 \u043f\u043e\u0432\u044b\u0441\u0438\u0442\u044c \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0441\u0432\u043e\u0435\u0433\u043e \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043c\u0430\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430. \u0421\u043f\u0443\u0441\u0442\u044f \u0442\u0440\u0438 \u043c\u0435\u0441\u044f\u0446\u0430 \u0448\u043a\u043e\u043b\u0430 \u0431\u044b\u043b\u0430 \u0437\u0430\u043a\u0440\u044b\u0442\u0430 \u043f\u043e\u0434 \u0434\u0430\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000\" class=\"mw-redirect\" title=\"2000\">2000<\/a>&#160;\u2014 \u0412\u043b\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B9%D0%B2%D0%B0%D0%BD%D1%8C\" title=\"\u0422\u0430\u0439\u0432\u0430\u043d\u044c\">\u0422\u0430\u0439\u0432\u0430\u043d\u044f<\/a> \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043b\u0438 25-\u043b\u0435\u0442\u043d\u0435\u0433\u043e \u0427\u044d\u043d \u0418\u043d\u044c-\u0425\u0430\u043e, \u0441\u043e\u0437\u0434\u0430\u0442\u0435\u043b\u044f \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u043d\u043e\u0433\u043e \u0432\u0438\u0440\u0443\u0441\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/CIH\" title=\"CIH\">CIH<\/a> (\u00ab\u0427\u0418\u0425\u00bb), \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u043f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u043b\u0430\u043c \u0430\u0432\u0442\u043e\u0440\u0430. \u0412 \u043d\u0430\u0440\u043e\u0434\u0435 \u0432\u0438\u0440\u0443\u0441 \u0438\u0437\u0432\u0435\u0441\u0442\u0435\u043d \u043a\u0430\u043a \u00ab\u0427\u0435\u0440\u043d\u043e\u0431\u044b\u043b\u044c\u00bb, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u0434\u043d\u0430 \u0438\u0437 \u0435\u0433\u043e \u0432\u0435\u0440\u0441\u0438\u0439 \u0430\u043a\u0442\u0438\u0432\u0438\u0440\u0443\u0435\u0442\u0441\u044f 26 \u0430\u043f\u0440\u0435\u043b\u044f, \u0432 \u0433\u043e\u0434\u043e\u0432\u0449\u0438\u043d\u0443 \u0430\u0432\u0430\u0440\u0438\u0438 \u043d\u0430 \u0430\u0442\u043e\u043c\u043d\u043e\u0439 \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u0441\u0442\u0430\u043d\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002\" class=\"mw-redirect\" title=\"2002\">2002<\/a>&#160;\u2014 \u0421\u0445\u043e\u0434 \u043b\u0435\u0434\u043d\u0438\u043a\u0430 \u041a\u043e\u043b\u043a\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BC%D0%B0%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%83%D1%89%D0%B5%D0%BB%D1%8C%D0%B5\" title=\"\u041a\u0430\u0440\u043c\u0430\u0434\u043e\u043d\u0441\u043a\u043e\u0435 \u0443\u0449\u0435\u043b\u044c\u0435\">\u041a\u0430\u0440\u043c\u0430\u0434\u043e\u043d\u0441\u043a\u043e\u043c \u0443\u0449\u0435\u043b\u044c\u0435<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%9E%D1%81%D0%B5%D1%82%D0%B8%D1%8F\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u041e\u0441\u0435\u0442\u0438\u044f\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u041e\u0441\u0435\u0442\u0438\u0438<\/a>. \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0441\u0442\u0438\u0445\u0438\u0439\u043d\u043e\u0433\u043e \u0431\u0435\u0434\u0441\u0442\u0432\u0438\u044f \u043f\u043e\u0433\u0438\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B4%D1%80%D0%BE%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0411\u043e\u0434\u0440\u043e\u0432, \u0421\u0435\u0440\u0433\u0435\u0439 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0421\u0435\u0440\u0433\u0435\u0439 \u0411\u043e\u0434\u0440\u043e\u0432<\/a> \u0438 \u0441\u044a\u0451\u043c\u043e\u0447\u043d\u0430\u044f \u0433\u0440\u0443\u043f\u043f\u0430 \u0444\u0438\u043b\u044c\u043c\u0430 \u00ab\u0421\u0432\u044f\u0437\u043d\u043e\u0439\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008\" class=\"mw-redirect\" title=\"2008\">2008<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D1%80%D0%BE%D1%80%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%BA%D1%82_%D0%B2_%D0%B3%D0%BE%D1%81%D1%82%D0%B8%D0%BD%D0%B8%D1%86%D0%B5_%D0%9C%D0%B0%D1%80%D1%80%D0%B8%D0%BE%D1%82_(%D0%98%D1%81%D0%BB%D0%B0%D0%BC%D0%B0%D0%B1%D0%B0%D0%B4,_2008)\" class=\"mw-redirect\" title=\"\u0422\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043a\u0442 \u0432 \u0433\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u0435 \u041c\u0430\u0440\u0440\u0438\u043e\u0442 (\u0418\u0441\u043b\u0430\u043c\u0430\u0431\u0430\u0434, 2008)\">\u0422\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043a\u0442 \u0432 \u0433\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u0435 \u041c\u0430\u0440\u0440\u0438\u043e\u0442<\/a>.<\/li><\/ul><h2>"}